column5:
Unmarshal original document outside locks during Update

- improve performance a bit;
- don't Unmarshal on part.Update error;
- new unit test for Update.

Always acquire lock for updating given document

- simplify code for access of given document;
- simplify concurrent update;
- greatly improve possibility for further update improvements (#111);
- fix #112;
- does not decrease performance of `tiedot -mode=bench` on my machine.

Fix some golint suggestions.

- Fix malformed comments;
- Remove useless branching from 'if' statements;
- Rewrite variable incrementation;
- Remove redundant empty variable from 'range' statements;
